import React, { useState, useRef, useEffect } from 'react';
import { 
  Container, Paper, Typography, TextField, Button, Box, 
  CircularProgress, Avatar, Divider, IconButton, ThemeProvider, 
  createTheme, CssBaseline
} from '@mui/material';
import SendIcon from '@mui/icons-material/Send';
import PsychologyIcon from '@mui/icons-material/Psychology';
import PersonIcon from '@mui/icons-material/Person';
import ReactMarkdown from 'react-markdown';
import axios from 'axios';

// Create a theme with Gen Z friendly colors
const theme = createTheme({
  palette: {
    primary: {
      main: '#6C63FF', // Vibrant purple
    },
    secondary: {
      main: '#FF6584', // Coral pink
    },
    background: {
      default: '#F9F9F9',
      paper: '#FFFFFF',
    },
  },
  typography: {
    fontFamily: '"Poppins", "Roboto", "Helvetica", "Arial", sans-serif',
    h4: {
      fontWeight: 600,
    },
  },
  shape: {
    borderRadius: 12,
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          textTransform: 'none',
          fontWeight: 600,
        },
      },
    },
  },
});

function App() {
  const [input, setInput] = useState('');
  const [messages, setMessages] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const messagesEndRef = useRef(null);

  // Sample welcome message
  useEffect(() => {
    setMessages([
      {
        text: "Hi there! I'm TheraPeek, your mental health chat companion. How are you feeling today?",
        sender: 'bot',
        timestamp: new Date(),
      },
    ]);
  }, []);

  // Auto-scroll to bottom of messages
  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  };

  const handleInputChange = (e) => {
    setInput(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!input.trim()) return;

    // Add user message to chat
    const userMessage = {
      text: input,
      sender: 'user',
      timestamp: new Date(),
    };
    setMessages((prev) => [...prev, userMessage]);
    setInput('');
    setLoading(true);
    setError(null);

    try {
      // Call API
      const response = await axios.post('/api/chat', {
        message: input,
        max_length: 100,
        temperature: 0.7,
      });

      // Add bot response to chat
      const botMessage = {
        text: response.data.response || "I'm not sure how to respond to that.",
        sender: 'bot',
        timestamp: new Date(),
        processingTime: response.data.processing_time,
      };
      setMessages((prev) => [...prev, botMessage]);
    } catch (err) {
      console.error('Error communicating with the API:', err);
      setError('Sorry, I had trouble connecting. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const formatTime = (date) => {
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="md" sx={{ height: '100vh', py: 4 }}>
        <Paper 
          elevation={3} 
          sx={{ 
            height: '100%', 
            display: 'flex', 
            flexDirection: 'column',
            overflow: 'hidden',
            borderRadius: 3,
          }}
        >
          {/* Header */}
          <Box sx={{ p: 2, bgcolor: 'primary.main', color: 'white' }}>
            <Typography variant="h4" component="h1" sx={{ display: 'flex', alignItems: 'center' }}>
              <PsychologyIcon sx={{ mr: 1, fontSize: 32 }} />
              TheraPeek
            </Typography>
            <Typography variant="subtitle1">
              Your Gen Z Mental Health Companion
            </Typography>
          </Box>

          {/* Messages Area */}
          <Box 
            sx={{ 
              flexGrow: 1, 
              p: 2, 
              overflowY: 'auto',
              display: 'flex',
              flexDirection: 'column',
              gap: 2,
            }}
          >
            {messages.map((msg, index) => (
              <Box 
                key={index}
                sx={{
                  display: 'flex',
                  flexDirection: msg.sender === 'user' ? 'row-reverse' : 'row',
                  alignItems: 'flex-start',
                  gap: 1,
                }}
              >
                <Avatar 
                  sx={{ 
                    bgcolor: msg.sender === 'user' ? 'secondary.main' : 'primary.main',
                  }}
                >
                  {msg.sender === 'user' ? <PersonIcon /> : <PsychologyIcon />}
                </Avatar>
                <Paper 
                  elevation={1}
                  sx={{
                    p: 2,
                    maxWidth: '70%',
                    bgcolor: msg.sender === 'user' ? 'secondary.light' : 'grey.100',
                    borderRadius: 2,
                  }}
                >
                  <ReactMarkdown>{msg.text}</ReactMarkdown>
                  <Typography variant="caption" display="block" sx={{ mt: 1, textAlign: 'right', opacity: 0.7 }}>
                    {formatTime(msg.timestamp)}
                    {msg.processingTime && ` · ${msg.processingTime}s`}
                  </Typography>
                </Paper>
              </Box>
            ))}
            {loading && (
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, ml: 2 }}>
                <Avatar sx={{ bgcolor: 'primary.main' }}>
                  <PsychologyIcon />
                </Avatar>
                <CircularProgress size={24} />
              </Box>
            )}
            {error && (
              <Box sx={{ p: 2, color: 'error.main', textAlign: 'center' }}>
                <Typography>{error}</Typography>
              </Box>
            )}
            <div ref={messagesEndRef} />
          </Box>

          <Divider />

          {/* Input Area */}
          <Box 
            component="form" 
            onSubmit={handleSubmit}
            sx={{ 
              p: 2, 
              display: 'flex', 
              alignItems: 'center',
              gap: 1,
              bgcolor: 'background.paper',
            }}
          >
            <TextField
              fullWidth
              variant="outlined"
              placeholder="Type your message here..."
              value={input}
              onChange={handleInputChange}
              disabled={loading}
              sx={{ 
                '& .MuiOutlinedInput-root': {
                  borderRadius: 3,
                }
              }}
            />
            <Button
              type="submit"
              variant="contained"
              color="primary"
              disabled={loading || !input.trim()}
              endIcon={<SendIcon />}
              sx={{ 
                height: 56,
                borderRadius: 3,
                px: 3,
              }}
            >
              Send
            </Button>
          </Box>
        </Paper>
      </Container>
    </ThemeProvider>
  );
}

export default App;
